import React from 'react';
import styled from 'styled-components';

/**
 * 임시 레이아웃용 컴포넌트 - 수정 예정
 */

const Wrapper = styled.div`
  height: auto;
  margin-bottom: 100px;
`;

const Map = (props) => {
  return <>
    <Wrapper>
      <img src="assets/images/tempMap(레이아웃용-삭제예정).png" alt="asdf" />
    </Wrapper>
  </>;
};

export default Map;
